import array
import zlib
import gzip
import bz2
import lzma
import base64

def compress_int_array(input):
    if type(input)==str:
        bytes_array = input.encode('utf-8')
    else:
        bytes_array = array.array('I', input).tobytes()
    results = {}
    # 使用zlib压缩
    zlib_compressed = zlib.compress(bytes_array)
    results['zlib'] = len(base64.b85encode(zlib_compressed))
    # 使用gzip压缩
    gzip_compressed = gzip.compress(bytes_array)
    results['gzip'] = len(base64.b85encode(gzip_compressed))
    # 使用bz2压缩
    bz2_compressed = bz2.compress(bytes_array)
    results['bz2'] = len(base64.b85encode(bz2_compressed))
    # 使用lzma压缩
    lzma_compressed = lzma.compress(bytes_array, preset=9)
    results['lzma'] = len(base64.b85encode(lzma_compressed))
    return results

